    tmp[6] = t6.a;
    tmp[7] = t8.d;
    tmp[8] = t7.b;
    tmp[9] = t10.a;
    tmp[10] = t1.b;
    tmp[11] = t10.b;
    tmp[12] = t10.c;
    tmp[13] = t4.b;
    tmp[14] = t10.d;
    tmp[15] = t6.b;
    tmp[16] = t9.a;
    tmp[17] = t7.c;
    tmp[18] = t0.c;
    tmp[19] = t9.b;
    tmp[20] = t2.c;
    tmp[21] = t9.c;
    tmp[22] = t9.d;
    tmp[23] = t5.c;
    tmp[24] = t5.d;
    tmp[25] = t11.a;
