static chain_t hamsi_block(block_t block, chain_t chain) {
#pragma HLS INLINE off
    state_t state = expand(block, chain);
    for (int i = 0; i < 6; i++) {
        state = add_constants(state, i);
        state = subsitute(state);
        state = diffuse(state);
    }
    return chain ^ (state[0], state[1], state[2], state[3], state[4], state[5], state[6], state[7],
        state[16], state[17], state[18], state[19], state[20], state[21], state[22], state[23]);
}

static chain_t hamsi_block_final(block_t block, chain_t chain) {
#pragma HLS INLINE off
    state_t state = expand(block, chain);
    for (int i = 0; i < 12; i++) {
        state = add_constants_final(state, i);
        state = subsitute(state);
        state = diffuse(state);
    }
    return chain ^ (state[0], state[1], state[2], state[3], state[4], state[5], state[6], state[7],
        state[16], state[17], state[18], state[19], state[20], state[21], state[22], state[23]);
}

void hamsi512_top(ap_uint<512> in, ap_uint<512> *out) {
#pragma HLS INTERFACE mode=ap_ctrl_none port=return
#pragma HLS INTERFACE mode=ap_none port=in
#pragma HLS INTERFACE mode=ap_none port=out
#pragma HLS PIPELINE II=1
    ap_uint<640> padded_msg = pad_512(in);
    chain_t chain = hamsi_block(padded_msg(639, 576), iv);
    chain = hamsi_block(padded_msg(575, 512), chain);
    chain = hamsi_block(padded_msg(511, 448), chain);
    chain = hamsi_block(padded_msg(447, 384), chain);
    chain = hamsi_block(padded_msg(383, 320), chain);
    chain = hamsi_block(padded_msg(319, 256), chain);
    chain = hamsi_block(padded_msg(255, 192), chain);
    chain = hamsi_block(padded_msg(191, 128), chain);
    chain = hamsi_block(padded_msg(127, 64), chain);
    chain = hamsi_block_final(padded_msg(63, 0), chain);
    *out = chain;
}
